import React from 'react';
import { reduxForm, Field } from 'redux-form';

//import s from './Header.module.css';
//import { NavLink } from 'react-router-dom';

const LoginForm = (props) => {
    return (
        <form onSubmit={props.handleSubmit}>
            <div>
                <Field placeholder={"Login"} name={"login"} component={"input"}></Field>
            </div>
            <div>
                <Field placeholder={"Password"} name={"password"} component={"input"}></Field>
            </div>
            <div>
                <Field type={"checkbox"} name={"rememberMe"} component={"input"}></Field>
                    remember me
                </div>
            <div>
                <button>Login</button>
            </div>
        </form>
    )
}

const ReduxLoginForm = reduxForm ({
    form: 'login'
})(LoginForm)

const LoginPage = (props) => {

    const onSubmitted = (formData) => {
        console.log(formData)
    }

    return (
        <div>
            <h1>Login</h1>
            <ReduxLoginForm onSubmit={onSubmitted} />
        </div>
    )
}
export default LoginPage;
